	(95, 'Justin Bieber - YUKON', 'Justin Bieber - YUKON', 'Shot and directed by Cole Bennett\n\nSong Producers: \nSir Dylan\nCarter Lang\nDaniel Chetrit\n\nCinematographer: Cole Bennett\nEditor: Cole Bennett\nColor Grade: Josh Bohoskey\nVFX Cleanup: Side - Eye + AID6N\nProduction Assistant: Camila Morrone \nProduction Company: Lyrical Lemonade\n\nStream/Download: https://JustinBieber.lnk.to/SWAG\nShop: https://JustinBieber.lnk.to/Shop\n\nFollow Justin: \nhttps://www.instagram.com/lilbieber\nhttp://twitter.com/justinbieber\nhttps://www.tiktok.com/@justinbieber\nhttp://facebook.com/justinbieber\n \nSign up for Justin’s newsletter: http://justinbiebermusic.com', 21968615, 183, '3:03', 'False', 56, 95),
	(96, 'Ariana Grande - twilight zone (Official Lyric Video)', 'Ariana Grande - twilight zone (Official Lyric Video)', 'The official “twilight zone” official lyric video by Ariana Grande. \n \nListen to & download ‘eternal sunshine deluxe: brighter days ahead’: https://arianagrande.lnk.to/esdeluxe\n \n►Subscribe to Ariana Grande: http://ArianaGrande.lnk.to/subscribe\n \n►Follow Ariana Grande\nInstagram: https://www.instagram.com/arianagrande/\nFacebook: https://www.facebook.com/arianagrande \nTikTok: https://www.tiktok.com/@arianagrande\nWebsite: https://www.arianagrande.com/ \n\ndirected by: @katiatemkin \nanimated by : @sofianinova \nproduced by: @themorganrussell\n \n#arianagrande #twilightzone #eternalsunshine\n\nMusic video by Ariana Grande performing twilight zone (Lyric Video).© 2025 Republic Records, a division of UMG Recordings, Inc.', 18245315, 202, '3:22', 'False', 61, 96),
	(97, 'Gracie Abrams - I Love You, I’m Sorry (Official Music Video)', 'Gracie Abrams - I Love You, I’m Sorry (Official Music Video)', 'Listen to the new album, The Secret of Us, out now: https://GracieAbrams.lnk.to/TheSecretofUs\n \nDirected by Audrey Hobert\n \nShop official Gracie merch and music: https://GracieAbrams.lnk.to/Shop\nShop limited-edition vinyl variants: https://GracieAbrams.lnk.to/ShopVinyl\n \nFollow Gracie Abrams:\nInstagram: https://www.instagram.com/gracieabrams/\nFacebook: https://www.facebook.com/gracieabrams\nTwitter: https://twitter.com/gracieabrams\nSnapchat: https://www.snapchat.com/add/gracieabrams\nTikTok: https://www.tiktok.com/@tehegracietehe\nTumblr: https://blog.gracieabrams.com/\nYouTube: https://www.youtube.com/gracieabrams\nEmail: https://smarturl.it/graciesmailinglist\n\nMusic video by Gracie Abrams performing I Love You, I\'m Sorry. © 2024 Gracie Abrams, under exclusive license to Interscope Records, a division of UMG Recordings, Inc.\n\nhttp://vevo.ly/nXOlbM', 31456772, 234, '3:54', 'False', 23, 97),
	(98, 'HoodTrophy Bino ft. FCG Heem - Miami (Official Music Video)', 'HoodTrophy Bino ft. FCG Heem - Miami (Official Music Video)', 'HoodTrophy Bino and FCG Heem drop Miami.  From Bino, “’Miami’ was a bridge for me from LA to the South sound.  The song is about seeing life in a different way – peaceful moments, no cares, feels like a vacation.  Also the ocean is different, it brings calm.”\n#hoodtrophybino #fcgheem #rap #newmusic #Miami#WestCoast #MiamiHipHop\n \nInstagram: @HoodTrophyBino         \nInstagram: @fcgheem\nTik Tok: @officialhoodtrophy          \nTikTok @fcgheem\nSpotify: HoodTrophy Bino\nApple Music: HoodTrophy Bino\n\n\n@fcgheem \n\nChosen Few Album Out Now On All Platform \nhttps://tr.ee/GoXQIRLQDw\nhttps://tr.ee/r08Ib1lzgG\n\nFollow Bino on Social Media\nInstagram:  https://www.instagram.com/hoodtrophybino/ \nTikTok: https://www.tiktok.com/@officialhoodtrophy\nYouTube: https://www.youtube.com/@hoodtrophybino\nApple Music: https://music.apple.com/us/artist/hoodtrophy-bino/1577266421\nSpotify: https://open.spotify.com/artist/3YmsAPif4mx4mSugYt1n4c?si=tWkw7a9dTEajTAduORDa4A\nPandora: https://www.pandora.com/artist/hoodtrophy-bino\n#HoodTrophyBino #musicvideo', 66051, 197, '3:17', 'False', 64, 98),
	(99, 'Sean Paul x INNA - Let It Talk To Me', 'Sean Paul x INNA - Let It Talk To Me', 'Song Title: Sean Paul x INNA - Let It Talk To Me\nArtist: Sean Paul @INNA \n\nAudio credits:\nPerformed by: Sean Paul, INNA\nBacking vocals: Mags Duval\nProgramming, Keyboards, and Bass: Johnny Goldstein\nWritten by: Sean Paul, Johnny Goldstein, Mags Duval, CASTLE\nProduced by: Johnny Goldstein\nMixed by: Josh Gudwin\nMix Assisted by: Felix Byrne\nMixed at Gudwin Sound, Hollywood CA\nMastered by: Chris Athens at Chris Athens Masters, in Austin, TX USA\nMastering Assistant: Dave Huffman\n\n(p): 2025, Global Records\n(c): 2025, Dutty Rock Music/EMI April Music o/b/o EMI Music Publishing Ltd, Sony/ATV Songs LLC/Artist 101 Publishing Group/Johnny Goldstein Publishing Designee, Music of Big Family / In Honor Of Alice Publishing, IAMCASTLE MUSIC PUBLISHING / Chumba Music\n\nVideo credits:\nProd. by Loops\nDirector: Bogdan Paun\nD.o.P.: Gosh\nEdit & Post Production: Bogdan Paun\n\nFollow Sean Paul On:\nFacebook: https://facebook.com/seanpaul\nTwitter: https://twitter.com/duttypaul\nInstagram: https://instagram.com/duttypaul/\nSoundCloud: https://soundcloud.com/seanpaulofficial\nWebsite: http://allseanpaul.com/\n\nINNA Online: \nFacebook: https://www.facebook.com/Inna\nInstagram: https://instagram.com/inna\nSpotify: https://smarturl.it/INNAOfficialSpotify\niTunes: https://smarturl.it/iTunesINNAOfficial\nTikTok: https://www.tiktok.com/@inna\n\nFollow Dutty Rock Production:\nFacebook: https://facebook.com/DuttyRockProductions\nTwitter: https://twitter.com/duttyrockprod\n\nWatch More Sean Paul:\nSean Paul Popular Videos: http://bit.ly/1Q9HAd6\nSean Paul Music & Lyric Videos: http://bit.ly/23XSlTU\nSean Paul Official Audio: http://bit.ly/1PDZcIm\nSean Paul Atlantic Records Releases: http://bit.ly/1ShJxUU\nSean Paul Best Collaborations: http://bit.ly/1Qsv8iT\n\nSean Paul Tour Dates: http://www.allseanpaul.com/events\n\nListen to Sean Paul On:\nSpotify: http://bit.ly/20pEDVc\niTunes: http://apple.co/1QsvmGD\nGooglePlay: http://bit.ly/2fdh9Xe\nAmazon mp3: http://amzn.to/1o09I5A\n\nSean Paul Bio:\nSean Paul began his musical career in 1996 and has attracted international attention that has seen him releasing six studio albums. The performer has been given the nod of approval by numerous international musical governing bodies and boasts 7 Grammy nominations as well as the 2006 American Music Award for favorite Pop/Rock Male Artiste.', 16952860, 155, '2:35', 'False', 65, 99),
	(100, 'Selena Gomez, benny blanco - How Does It Feel To Be Forgotten (Official Lyric Video)', 'Selena Gomez, benny blanco - How Does It Feel To Be Forgotten (Official Lyric Video)', 'Listen to the new album \'I Said I Love You First\', out now: https://sgxbb.lnk.to/ISaidILoveYouFirst\n\nShop new merch: https://selenagomez.lnk.to/store \nJoin Selena’s mailing list: https://selenagomez.lnk.to/SignUp\nJoin benny’s mailing list: https://bennyblanco.lnk.to/SignUp\n\nFollow Selena Gomez: \nInstagram: https://selenagomez.lnk.to/Instagram\nTwitter: https://selenagomez.lnk.to/Twitter\nFacebook: https://selenagomez.lnk.to/Facebook\nTikTok: https://selenagomez.lnk.to/TikTok\nYouTube: https://selenagomez.lnk.to/YouTube\n\nFollow benny blanco: \nInstagram: https://bennyblanco.lnk.to/Instagram\nTwitter: https://bennyblanco.lnk.to/Twitter\nFacebook: https://bennyblanco.lnk.to/Facebook\nTikTok: https://bennyblanco.lnk.to/TikTok\nYouTube: https://bennyblanco.lnk.to/YouTube\n\nLyrics: \n\nI sip it in the way he likes \nRuby red\nLocking eyes\nLipstick kisses with no ice \nOn the edge\nParadise\n\nYou walked in, big ass grin\nTalking like we’re friends, honey what were you thinking \nHe loves me, I love him\nLook at you\nJust look at you now\n\nYou\'re so embarrassing\nGo cry where no one’s watching \nI can’t imagine it\nHow does it feel to be forgotten? \nForgotten (ah)\nForgotten (ah)\nHow does it feel?\nI hope one day you heal\nHow does it feel to be forgotten? \nForgotten\n\nI know it must be difficult\nI know it isn’t what you thought\n\nCause walked in, big ass grin\nTalking like the friend’s honey what were you thinking? \nHe loves me, I love him\nLook at you\nJust look at you now\n\nYou’re so embarrassing\nGo cry when no one’s watching \nI can’t imagine it\nHow does it feel to be forgotten? \nForgotten (ah)\nForgotten (ah)\n\nHow does it feel?\nI hope one day you heal\nHow does it feel to be forgotten? \nForgotten\n\nAhora todo está dicho y hecho\nTodo está olvidado\n\n-English Translation: \nNow, everything is said and done. \nEverything is forgotten\n\n#SelenaGomez #bennyblanco #HowDoesItFeelToBeForgotten #ISaidILoveYouFirst\n\nMusic video by Selena Gomez, benny blanco performing How Does It Feel To Be Forgotten (Lyric Video).© 2024 SMG Music LLC & Friends Keep Secrets, under exclusive license to Interscope Records', 16971256, 161, '2:41', 'False', 63, 100);
